INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES ("クリア", 325, 24001, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 5, 0, 2, 2, 126001, 40011, 1);
